def calc_square(route):
    tile_index = []
    for i in route:
        lat = float(i.get('lat'))
        lon = float(i.get('lon'))
        tile_index_x, tile_index_y = deg2num(lat, lon, 15)
        tile_index_temp = {'x':tile_index_x,'y': tile_index_y}
        if tile_index_temp not in tile_index:
            tile_index.append(tile_index_temp)

    total_square = 0
    for tiles in tile_index:
        x=tiles.get('x')
        y=tiles.get('y')
        total_square = total_square + calc_corners(x,y,15)
